import { Container } from 'shards-react';
import { Row, Col } from 'shards-react';

// components
import MailingListSubscribe from '../components/MailingListSubscribe';
import Layout from '../components/Layout';

const Index = props => (
	<Layout>
		<Container>
			<Row>
				<Col></Col>
				<Col md={4}></Col>
			</Row>
		</Container>
	</Layout>
);

export default Index;
